import React, { Component } from 'react' ;
import Header from '../Common/Header' ;
class Home extends Component {
    render() {
        return (
            <div>
                <Header 
                title= "Welcome To Our Studio!"
                subtitle = "IT'S NICE TO MEET YOU"
                buttonText = "Tell Me More"
                link = "/service"
                showButton={true}
                />         
            </div>
        )
    }
}

export default Home;
